	(1117,302,'add_order',NULL,NULL,'<SOAP-ENV:Envelope xmlns:SOAP-ENC=\"http://schemas.xmlsoap.org/soap/encoding/\" xmlns:SOAP-ENV=\"http://schemas.xmlsoap.org/soap/envelope/\" xmlns:ZSI=\"http://www.zolera.com/schemas/ZSI/\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" SOAP-ENV:encodingStyle=\"http://schemas.xmlsoap.org/soap/encoding/\"><SOAP-ENV:Header></SOAP-ENV:Header><SOAP-ENV:Body xmlns:ns1=\"http://10.80.0.169/add_order\"><ns1:add_order><passkey>webstore</passkey><strId>WO-52001</strId><intDttDate>1339657200</intDttDate><intDttDue>1339657200</intDttDue><strPrintedNotes>WO-52001\n\nThe biggest difference is lack of detail in a screenplay. People coming from a literary background often get hung up on putting in detail into descriptions that just doesn\'t belong. And people who aren\'t used to reading screenplays -- your family and friends -- can frequently be thrown off by the lack of description.&#xD;\n&#xD;\nA novel might have a passage like:&#xD;\n&#xD;\nTimmy concentrated on putting one foot in front of the other as he approached the old barn. The rotting structure, built by his grandfather when he first came to America, had fallen into disrepair since his grandparents had died. The paint, so carefully picked out by his grandmother in a shade of rouge to perfectly match her haircolor, had long since faded and cracked in the rough Nebraska sun. Timmy felt the cold wind blow up a tuft of his hair, momentarily freezing him. He imagined his grandmother\'s breath on his neck before shaking the feeling and forging ahead.&#xD;\n&#xD;\nThis is what this is going to look like in a screenplay:&#xD;\n&#xD;\nEXT. OLD BARN - DAY&#xD;\n&#xD;\nTimmy carefully approaches the barn.&#xD;\n&#xD;\n&#xD;\nThat\'s the difference.</strPrintedNotes><strStatus>Requested</strStatus><strEmail>kris@example.com</strEmail><strPhone>8989</strPhone><strZipcode></strZipcode><intTaxcode>104</intTaxcode><fltShippingSell>0.000000</fltShi