	(431,100,'save_product',NULL,'add','<SOAP-ENV:Envelope xmlns:SOAP-ENC=\"http://schemas.xmlsoap.org/soap/encoding/\" xmlns:SOAP-ENV=\"http://schemas.xmlsoap.org/soap/envelope/\" xmlns:ZSI=\"http://www.zolera.com/schemas/ZSI/\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" SOAP-ENV:encodingStyle=\"http://schemas.xmlsoap.org/soap/encoding/\"><SOAP-ENV:Header></SOAP-ENV:Header><SOAP-ENV:Body xmlns:ns1=\"http://10.80.0.169/save_product\"><ns1:save_product><passkey>webstore</passkey><intRowid>117</intRowid><strCode>Sunkist-Regular-Small</strCode><strName>Sunkist Soda, Regular, Small</strName><blbImage></blbImage><strClassName>Beverages</strClassName><blnCurrent>1</blnCurrent><strDescription>Sunkist is a brand of primarily orange flavored soft drinks launched in 1979.&#xD;Sunkist was first licensed by Sunkist Growers to the General Cinema Corporation, the leading independent bottler of Pepsi-Cola products at the time. The soft drink was the idea of Mark Stevens, who foresaw the potential based on market research which indicated that, worldwide, orange was the third best selling soft drink flavor (largely due to The Coca-Cola Company\'s Fanta brand).&#xD;After extensive R&amp;D during 1977 and early 1978, in which research was conducted on taste, color and carbonation levels, Sunkist made a grand introduction in New York by franchising it to The Coca-Cola Bottling Company of New York, where Edward F. O\'Reilly was president. At the time of introduction, Sunkist Soft Drinks had only five key employees: Mark Stevens, President; Peter Murphy, VP Sales; Dr. John Leffingwell, VP R&amp;D; Ray Sissom, VP Finance; and Jim DeDreu, NE Regional Manager. It went national soon thereafter by being franchised mainly to leading Coca-Cola and Pepsi-Cola bottlers. The advertising slogan was \"fun, sun and the beach\" using TV and radio commercials with the Beach Boys\' hit song \"Good Vibrations\" as the brand\'s theme. In 1980, Sunkist Orange Soda became the #1 orange soda in the USA and the 10th best selling soft drink. Unlike many other competing orange sodas, Sunkist contains caffeine (41.0mg).</strDescription><strDescriptionShort xsi:nil=\"1\"></strDescriptionShort><strFamily xsi:nil=\"1\"></strFamily><blnGiftCard>0</blnGiftCard><blnInventoried>1</blnInventoried><fltInventory>1.000000</fltInventory><fltInventoryTotal>1.000000</fltInventoryTotal><blnMasterModel>0</blnMasterModel><intMasterId>116</intMasterId><strProductColor>Regular</strProductColor><strProductSize>Small</strProductSize><fltProductHeight>0.000000</fltProductHeight><fltProductLength>0.000000</fltProductLength><fltProductWidth>0.000000</fltProductWidth><fltProductWeight>0.000000</fltProductWeight><intTaxStatusId>0</intTaxStatusId><fltSell>1.990000</fltSell><fltSellTaxInclusive>2.090000</fltSellTaxInclusive><fltSellWeb>0.000000</fltSellWeb><strUpc xsi:nil=\"1\"></strUpc><blnOnWeb>1</blnOnWeb><strWebKeyword1 xsi:nil=\"1\"></strWebKeyword1><strWebKeyword2 xsi:nil=\"1\"></strWebKeyword2><strWebKeyword3 xsi:nil=\"1\"></strWebKeyword3><blnFeatured>0</blnFeatured><strCategoryPath>Default</strCategoryPath></ns1:save_product></SOAP-ENV:Body></SOAP-ENV:Envelope>','OK',1),
