	(565,100,'save_product',NULL,'add','<SOAP-ENV:Envelope xmlns:SOAP-ENC=\"http://schemas.xmlsoap.org/soap/encoding/\" xmlns:SOAP-ENV=\"http://schemas.xmlsoap.org/soap/envelope/\" xmlns:ZSI=\"http://www.zolera.com/schemas/ZSI/\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" SOAP-ENV:encodingStyle=\"http://schemas.xmlsoap.org/soap/encoding/\"><SOAP-ENV:Header></SOAP-ENV:Header><SOAP-ENV:Body xmlns:ns1=\"http://10.80.0.169/save_product\"><ns1:save_product><passkey>webstore</passkey><intRowid>88</intRowid><strCode>7Up</strCode><strName>7Up Soda 12 ounce can</strName><blbImage></blbImage><strClassName>Beverages</strClassName><blnCurrent>1</blnCurrent><strDescription>7 Up is a brand of a lemon-lime flavored non-caffeinated soft drink. The rights to the brand are held by Dr Pepper Snapple Group in the United States, and PepsiCo (or its licensees) in the rest of the world, including Puerto Rico, where the concentrate is manufactured at the Pepsi facility in Cidra. The 7 Up logo includes a red spot between the \'7\' and \'Up\'; this red spot has been animated and used as a mascot for the brand as Cool Spot.&#xD;History&#xD;&#xD;7 Up was created by Charles Leiper Grigg, who launched his St. Louis-based company The Howdy Corporation in 1920. Grigg came up with the formula for a lemon-lime soft drink in 1929. The product, originally named \"Bib-Label Lithiated Lemon-Lime Soda\", was launched two weeks before the Wall Street Crash of 1929. It contained lithium citrate, a mood-stabilizing drug, until 1950. It was one of a number of patent medicine products popular in the late-19th and early-20th centuries.&#xD;&#xD;Philip Morris bought 7 Up in 1978, and sold it in 1986, to a group led by the investment firm Hicks &amp; Haas. 7 Up merged with Dr Pepper in 1988; Cadbury Schweppes bought the combined company in 1995. The Dr Pepper Snapple Group was spun off from Cadbury Schweppes in 2008.</strDescription><strDescriptionShort>7Up is a Bubbly Refreshing Soda</strDescriptionShort><strFamily>Coca-Cola Brands</strFamily><blnGiftCard>0</blnGiftCard><blnInventoried>1</blnInventoried><fltInventory>74.000000</fltInventory><fltInventoryTotal>76.000000</fltInventoryTotal><blnMasterModel>0</blnMasterModel><intMasterId>0</intMasterId><strProductColor xsi:nil=\"1\"></strProductColor><strProductSize xsi:nil=\"1\"></strProductSize><fltProductHeight>0.000000</fltProductHeight><fltProductLength>0.000000</fltProductLength><fltProductWidth>0.000000</fltProductWidth><fltProductWeight>0.500000</fltProductWeight><intTaxStatusId>0</intTaxStatusId><fltSell>1.690000</fltSell><fltSellTaxInclusive>14.300000</fltSellTaxInclusive><fltSellWeb>0.000000</fltSellWeb><strUpc xsi:nil=\"1\"></strUpc><blnOnWeb>1</blnOnWeb><strWebKeyword1>yikes</strWebKeyword1><strWebKeyword2 xsi:nil=\"1\"></strWebKeyword2><strWebKeyword3 xsi:nil=\"1\"></strWebKeyword3><blnFeatured>0</blnFeatured><strCategoryPath>Beverages	Carbonated</strCategoryPath></ns1:save_product></SOAP-ENV:Body></SOAP-ENV:Envelope>','OK',1),
