	(579,100,'save_product',NULL,'add','<SOAP-ENV:Envelope xmlns:SOAP-ENC=\"http://schemas.xmlsoap.org/soap/encoding/\" xmlns:SOAP-ENV=\"http://schemas.xmlsoap.org/soap/envelope/\" xmlns:ZSI=\"http://www.zolera.com/schemas/ZSI/\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" SOAP-ENV:encodingStyle=\"http://schemas.xmlsoap.org/soap/encoding/\"><SOAP-ENV:Header></SOAP-ENV:Header><SOAP-ENV:Body xmlns:ns1=\"http://10.80.0.169/save_product\"><ns1:save_product><passkey>webstore</passkey><intRowid>89</intRowid><strCode>5Alive</strCode><strName>Five Alive</strName><blbImage></blbImage><strClassName xsi:nil=\"1\"></strClassName><blnCurrent>1</blnCurrent><strDescription>Five Alive (currently stylized as 5 alive) is a line of fruit juice blends created by Minute Maid, a sub brand of The Coca-Cola Company. The name refers to the five fruit juices each variety contains. Five Alive\'s slogan is currently \"Feel Alive!\", and has the tag-line of \"Come alive with 5 Alive\" in the UK, and \"Five Alive is a refreshing citrus beverage for families that contains the juice of five citrus fruits you can enjoy all day long\" in the USA. In the 1980s, it was promoted by Wayland Flowers and Madame.&#xD;&#xD;Once widely available in the U.S., it is now more difficult to find. Five Alive is, however, still widely distributed in Canada and in the UK, as a plastic bottled or canned drink, also in 250 ml cartons suitable for vending machines or as a frozen concentrate. Also available in 1.89L cartons or 2.44L plastic jugs), as well as 200mL tetrapak boxes.&#xD;&#xD;</strDescription><strDescriptionShort xsi:nil=\"1\"></strDescriptionShort><strFamily xsi:nil=\"1\"></strFamily><blnGiftCard>0</blnGiftCard><blnInventoried>1</blnInventoried><fltInventory>100.000000</fltInventory><fltInventoryTotal>100.000000</fltInventoryTotal><blnMasterModel>0</blnMasterModel><intMasterId>0</intMasterId><strProductColor xsi:nil=\"1\"></strProductColor><strProductSize xsi:nil=\"1\"></strProductSize><fltProductHeight>0.000000</fltProductHeight><fltProductLength>0.000000</fltProductLength><fltProductWidth>0.000000</fltProductWidth><fltProductWeight>0.000000</fltProductWeight><intTaxStatusId>38</intTaxStatusId><fltSell>4.620000</fltSell><fltSellTaxInclusive>4.620000</fltSellTaxInclusive><fltSellWeb>0.000000</fltSellWeb><strUpc xsi:nil=\"1\"></strUpc><blnOnWeb>1</blnOnWeb><strWebKeyword1 xsi:nil=\"1\"></strWebKeyword1><strWebKeyword2 xsi:nil=\"1\"></strWebKeyword2><strWebKeyword3 xsi:nil=\"1\"></strWebKeyword3><blnFeatured>0</blnFeatured><strCategoryPath>Beverages	Carbonated</strCategoryPath></ns1:save_product></SOAP-ENV:Body></SOAP-ENV:Envelope>','OK',1),
