	(586,100,'save_product',NULL,'add','<SOAP-ENV:Envelope xmlns:SOAP-ENC=\"http://schemas.xmlsoap.org/soap/encoding/\" xmlns:SOAP-ENV=\"http://schemas.xmlsoap.org/soap/envelope/\" xmlns:ZSI=\"http://www.zolera.com/schemas/ZSI/\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" SOAP-ENV:encodingStyle=\"http://schemas.xmlsoap.org/soap/encoding/\"><SOAP-ENV:Header></SOAP-ENV:Header><SOAP-ENV:Body xmlns:ns1=\"http://10.80.0.169/save_product\"><ns1:save_product><passkey>webstore</passkey><intRowid>106</intRowid><strCode>AWRootBeer-Regular-L</strCode><strName>A&amp;W Root Beer, Regular/Regular/Regular/Regular/Regular/RegularRegular, L</strName><blbImage></blbImage><strClassName xsi:nil=\"1\"></strClassName><blnCurrent>1</blnCurrent><strDescription>A&amp;W Root Beer is a brand of root beer, primarily available in the United States and Canada, that was started in 1919 by Roy Allen.[1] In 1922, Allen partnered with Frank Wright. They combined their initials to create the brand \"A&amp;W\" and inspired a restaurant chain which was founded 1922. The first A&amp;W root beer drinks were sold for five cents. A&amp;W Root Beer is often referred to as the root beer standard amongst root beer reviewers.</strDescription><strDescriptionShort xsi:nil=\"1\"></strDescriptionShort><strFamily>Coca-Cola</strFamily><blnGiftCard>0</blnGiftCard><blnInventoried>1</blnInventoried><fltInventory>0.000000</fltInventory><fltInventoryTotal>0.000000</fltInventoryTotal><blnMasterModel>0</blnMasterModel><intMasterId>101</intMasterId><strProductColor>Regular/Regular/Regular/Regular/Regular/RegularRegular</strProductColor><strProductSize>Large/Big/Large/Big</strProductSize><fltProductHeight>0.000000</fltProductHeight><fltProductLength>0.000000</fltProductLength><fltProductWidth>0.000000</fltProductWidth><fltProductWeight>0.000000</fltProductWeight><intTaxStatusId>0</intTaxStatusId><fltSell>6.490000</fltSell><fltSellTaxInclusive>6.830000</fltSellTaxInclusive><fltSellWeb>0.000000</fltSellWeb><strUpc xsi:nil=\"1\"></strUpc><blnOnWeb>1</blnOnWeb><strWebKeyword1 xsi:nil=\"1\"></strWebKeyword1><strWebKeyword2 xsi:nil=\"1\"></strWebKeyword2><strWebKeyword3 xsi:nil=\"1\"></strWebKeyword3><blnFeatured>0</blnFeatured><strCategoryPath>Beverages</strCategoryPath></ns1:save_product></SOAP-ENV:Body></SOAP-ENV:Envelope>','OK',1);
