	(476,100,'save_product',NULL,'add','<SOAP-ENV:Envelope xmlns:SOAP-ENC=\"http://schemas.xmlsoap.org/soap/encoding/\" xmlns:SOAP-ENV=\"http://schemas.xmlsoap.org/soap/envelope/\" xmlns:ZSI=\"http://www.zolera.com/schemas/ZSI/\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" SOAP-ENV:encodingStyle=\"http://schemas.xmlsoap.org/soap/encoding/\"><SOAP-ENV:Header></SOAP-ENV:Header><SOAP-ENV:Body xmlns:ns1=\"http://10.80.0.169/save_product\"><ns1:save_product><passkey>webstore</passkey><intRowid>18</intRowid><strCode>GOLDBAR</strCode><strName>A bar of gold</strName><blbImage></blbImage><strClassName></strClassName><blnCurrent>1</blnCurrent><strDescription>There are, contrary to what many people think, more than one type of gold bar, over 30 different types of gold bars in fact. They range from the 400 troy ounce bars used by banks to the wafer thin fine gold bars of 1 gram made by Mitsubishi and used heavily in Japan.&#xD;&lt;P&gt;&#xD;A gold bar is generally defined as any gold item, regardless of shape, which means it does not even have to be in the shape of a bar, and which is made by a bar manufacturer, records the name of the manufacturer, the precise weight and the precise purity, and is sold at a low premium above the gold price. There are bars made by most countries in the world today. Most countries make, or have made gold bars of one sort of another. Also many shapes, not just the bar like shapes.&#xD;&#xD;For more information, see &lt;a href=\"http://fortknox.com\"&gt;Fort Knox&lt;/a&gt;</strDescription><strDescriptionShort>This is a fabulous gold bar. Please note this is not wrapped chocolate.</strDescriptionShort><strFamily></strFamily><blnGiftCard>0</blnGiftCard><blnInventoried>1</blnInventoried><fltInventory>9.000000</fltInventory><fltInventoryTotal>9.000000</fltInventoryTotal><blnMasterModel>0</blnMasterModel><intMasterId>0</intMasterId><strProductColor></strProductColor><strProductSize></strProductSiz