	(493,100,'save_product',NULL,'add','<SOAP-ENV:Envelope xmlns:SOAP-ENC=\"http://schemas.xmlsoap.org/soap/encoding/\" xmlns:SOAP-ENV=\"http://schemas.xmlsoap.org/soap/envelope/\" xmlns:ZSI=\"http://www.zolera.com/schemas/ZSI/\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" SOAP-ENV:encodingStyle=\"http://schemas.xmlsoap.org/soap/encoding/\"><SOAP-ENV:Header></SOAP-ENV:Header><SOAP-ENV:Body xmlns:ns1=\"http://10.80.0.169/save_product\"><ns1:save_product><passkey>webstore</passkey><intRowid>138</intRowid><strCode>BOXH2O-Carton-250ml</strCode><strName>Boxed Water, Carton, 250ml</strName><blbImage></blbImage><strClassName xsi:nil=\"1\"></strClassName><blnCurrent>1</blnCurrent><strDescription> Boxed Water is a product whose name states exactly what it is: water in a box. And with no mention of the source or benefits of the water (aside from a tiny purified drinking water tag), its the box that is the entire selling point of the water As for the box, its a 500 mL screw top carton that looks like a miniature version of a quart of milk (Boxed Water was originally launched in a quart size). The design of the package is otherwise very stark, which seems like a very subtle but effective way of saying that this is an eco-friendly product (or at least one that is more eco-friendly than water). In addition, theyve placed a list of the steps theyve taken to minimize the products impact on the environment over traditional bottled water. However, its still a lined carton, which, much like the Tetra Pak cartons, cannot be recycled in very many places at this point. To that end, there are certainly going to be naysayers on a product like this (and perhaps is why they changed the copy from Boxed water is better for the earth. to Boxed water is better.) whereas there would probably be way fewer if it were simply marketed as a cool and innovative looking package. We certainly think that this product could sell simply on that angle alone. Overall, really nice packaging design, but the environmental angle is likely to be a double-edged sword for the brand. </strDescription><strDescriptionShort xsi:nil=\"1\"></strDescriptionShort><strFamily>House Brand</strFamily><blnGiftCard>0</blnGiftCard><blnInventoried>1</blnInventoried><fltInventory>0.000000</fltInventory><fltInventoryTotal>0.000000</fltInventoryTotal><blnMasterModel>0</blnMasterModel><intMasterId>137</intMasterId><strProductColor>Carton</strProductColor><strProductSize>250ml</strProductSize><fltProductHeight>0.000000</fltProductHeight><fltProductLength>0.000000</fltProductLength><fltProductWidth>0.000000</fltProductWidth><fltProductWeight>0.000000</fltProductWeight><intTaxStatusId>0</intTaxStatusId><fltSell>53.950000</fltSell><fltSellTaxInclusive>56.780000</fltSellTaxInclusive><fltSellWeb>41.950000</fltSellWeb><strUpc xsi:nil=\"1\"></strUpc><blnOnWeb>1</blnOnWeb><strWebKeyword1>water</strWebKeyword1><strWebKeyword2 xsi:nil=\"1\"></strWebKeyword2><strWebKeyword3 xsi:nil=\"1\"></strWebKeyword3><blnFeatured>0</blnFeatured><strCategoryPath>Default</strCategoryPath></ns1:save_product></SOAP-ENV:Body></SOAP-ENV:Envelope>','OK',1),
